// ==UserScript==
// @name         Fineify Mods (Custom Themes)
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  Get custom themes for every website (dark mode, light mode or custom)
// @author       Fineify
// @match        https://classroom.google.com/h
// @match        https://classroom.google.com
// @match        https://classroom.google.com/?pli=1
// @icon         data:image/png;base64,
// @grant        none
// @foo        Fineify
// @downloadURL https://update.greasyfork.org/scripts/523391/Fineify%20Mods%20%28Custom%20Themes%29.user.js
// @updateURL https://update.greasyfork.org/scripts/523391/Fineify%20Mods%20%28Custom%20Themes%29.meta.js
// ==/UserScript==

(function () {
    'use strict';

    (function () {
        let menuOpen = false;
        let rainbowInterval = null;
        let moneyRainInterval = null;

        function showIntro(callback) {
            const intro = document.createElement("div");
            intro.style.position = "fixed";
            intro.style.top = "0";
            intro.style.left = "0";
            intro.style.width = "100%";
            intro.style.height = "100%";
            intro.style.background = "linear-gradient(to right, #3498db, #9b59b6)";
            intro.style.display = "flex";
            intro.style.alignItems = "center";
            intro.style.justifyContent = "center";
            intro.style.zIndex = "9999";
            intro.style.transition = "opacity 1s ease";
            intro.style.fontFamily = "'Arial', sans-serif";
            intro.style.animation = "fadeInScale 1.5s ease";

            const introContent = document.createElement("div");
            introContent.style.textAlign = "center";
            introContent.style.color = "white";

            const introTitle = document.createElement("h1");
            introTitle.textContent = "Fineify Mods";
            introTitle.style.fontSize = "3rem";
            introTitle.style.marginBottom = "1rem";
            introTitle.style.textShadow =
                "0 0 10px rgba(255, 255, 255, 0.9), 0 0 20px rgba(52, 152, 219, 0.8), 0 0 30px rgba(155, 89, 182, 0.7)";

            const introSubtitle = document.createElement("p");
            introSubtitle.textContent = "Custom Theme Menu";
            introSubtitle.style.fontSize = "1.2rem";

            introContent.appendChild(introTitle);
            introContent.appendChild(introSubtitle);
            intro.appendChild(introContent);
            document.body.appendChild(intro);

            // Keyframe animation styles
            const style = document.createElement("style");
            style.textContent = `
                @keyframes fadeInScale {
                    0% {
                        opacity: 0;
                        transform: scale(0.8);
                    }
                    100% {
                        opacity: 1;
                        transform: scale(1);
                    }
                }
            `;
            document.head.appendChild(style);

            setTimeout(() => {
                intro.style.opacity = "0";
                setTimeout(() => {
                    intro.remove();
                    if (callback) callback();
                }, 1000);
            }, 3000);
        }

        function makeDraggable(element) {
            let isDragging = false;
            let offsetX, offsetY;

            const onMouseMove = (e) => {
                if (!isDragging) return;
                requestAnimationFrame(() => {
                    element.style.left = `${e.clientX - offsetX}px`;
                    element.style.top = `${e.clientY - offsetY}px`;
                });
            };

            const onMouseUp = () => {
                if (isDragging) {
                    isDragging = false;
                    element.style.cursor = "grab";
                    document.removeEventListener("mousemove", onMouseMove);
                    document.removeEventListener("mouseup", onMouseUp);
                }
            };

            element.addEventListener("mousedown", (e) => {
                if (e.target.tagName === "INPUT" || e.target.tagName === "BUTTON") return;
                isDragging = true;
                offsetX = e.clientX - element.offsetLeft;
                offsetY = e.clientY - element.offsetTop;
                element.style.cursor = "grabbing";
                document.addEventListener("mousemove", onMouseMove);
                document.addEventListener("mouseup", onMouseUp);
                e.preventDefault();
            });
        }

        function makeItRain() {
            const emoji = "";
            const drop = () => {
                const el = document.createElement("div");
                el.textContent = emoji;
                el.style.position = "fixed";
                el.style.left = `${Math.random() * 100}%`;
                el.style.top = `-50px`;
                el.style.fontSize = "24px";
                el.style.animation = "fall 3s linear";
                el.style.pointerEvents = "none";
                el.style.zIndex = "9999";
                document.body.appendChild(el);

                el.addEventListener("animationend", () => el.remove());
            };

            const style = document.createElement("style");
            style.textContent = `
                @keyframes fall {
                    0% { transform: translateY(0); }
                    100% { transform: translateY(110vh); }
                }
            `;
            document.head.appendChild(style);

            if (!moneyRainInterval) {
                moneyRainInterval = setInterval(drop, 200);
            } else {
                clearInterval(moneyRainInterval);
                moneyRainInterval = null;
            }
        }

        function createUI() {
            if (menuOpen) return;
            menuOpen = true;

            const panel = document.createElement("div");
            panel.style.position = "fixed";
            panel.style.top = "50px";
            panel.style.left = "50px";
            panel.style.width = "420px";
            panel.style.background = "rgba(40, 44, 52, 0.95)";
            panel.style.borderRadius = "16px";
            panel.style.padding = "25px";
            panel.style.zIndex = "9999";
            panel.style.fontFamily = "'Arial', sans-serif";
            panel.style.color = "#ffffff";
            panel.style.boxShadow = "0 10px 25px rgba(0, 0, 0, 0.3)";
            panel.style.transition = "all 0.3s ease";
            panel.style.cursor = "grab";

            const title = document.createElement("h2");
            title.textContent = "Fineify Mods";
            title.style.textAlign = "center";
            title.style.marginBottom = "5px";
            title.style.fontSize = "24px";
            title.style.color = "#ffffff";
            title.style.textShadow =
                "0 0 10px rgba(255, 255, 255, 0.9), 0 0 20px rgba(52, 152, 219, 0.8), 0 0 30px rgba(155, 89, 182, 0.7)";
            panel.appendChild(title);

            const versionText = document.createElement("p");
            versionText.textContent = "Version 1.1";
            versionText.style.textAlign = "center";
            versionText.style.marginBottom = "15px";
            versionText.style.fontSize = "14px";
            versionText.style.color = "rgba(255, 255, 255, 0.8)";
            versionText.style.textShadow = "0 0 5px rgba(0, 0, 0, 0.5)";
            panel.appendChild(versionText);

            const closeButton = document.createElement("button");
            closeButton.textContent = "";
            closeButton.style.width = "40px";
            closeButton.style.height = "40px";
            closeButton.style.borderRadius = "50%";
            closeButton.style.border = "none";
            closeButton.style.background = "#e74c3c";
            closeButton.style.color = "white";
            closeButton.style.cursor = "pointer";
            closeButton.style.position = "absolute";
            closeButton.style.top = "15px";
            closeButton.style.right = "15px";
            closeButton.style.fontSize = "18px";
            closeButton.onclick = () => {
                panel.remove();
                menuOpen = false;
                clearInterval(moneyRainInterval);
                moneyRainInterval = null;
            };
            panel.appendChild(closeButton);

            const tabContainer = document.createElement("div");
            tabContainer.style.display = "flex";
            tabContainer.style.justifyContent = "space-between";
            tabContainer.style.marginBottom = "15px";

            const tabs = ["Colors", "Gradients", "Images", "Fun"];
            const contentSections = [];

            tabs.forEach((tab, index) => {
                const button = document.createElement("button");
                button.textContent = tab;
                button.style.flex = "1";
                button.style.margin = "0 5px";
                button.style.padding = "10px";
                button.style.border = "none";
                button.style.borderRadius = "8px";
                button.style.backgroundColor = index === 0 ? "#3498db" : "#2c3e50";
                button.style.color = "white";
                button.style.cursor = "pointer";
                button.onclick = () => {
                    tabs.forEach((_, i) => {
                        contentSections[i].style.display = i === index ? "block" : "none";
                        tabContainer.children[i].style.backgroundColor =
                            i === index ? "#3498db" : "#2c3e50";
                    });
                };
                tabContainer.appendChild(button);
            });
            panel.appendChild(tabContainer);

            tabs.forEach(() => {
                const contentSection = document.createElement("div");
                contentSection.style.display = "none";
                panel.appendChild(contentSection);
                contentSections.push(contentSection);
            });
            contentSections[0].style.display = "block"; // Show the first tab by default

            // Colors Tab
            const colorPicker = document.createElement("input");
            colorPicker.type = "color";
            colorPicker.style.width = "100%";
            colorPicker.style.marginBottom = "10px";
            colorPicker.oninput = () => {
                document.body.style.background = colorPicker.value;
                document.body.removeAttribute("data-gradient-active");
            };
            contentSections[0].appendChild(colorPicker);

            // Gradients Tab
            const gradientButton = document.createElement("button");
            gradientButton.textContent = "Random Gradient";
            gradientButton.style.width = "100%";
            gradientButton.style.padding = "10px";
            gradientButton.style.border = "none";
            gradientButton.style.borderRadius = "8px";
            gradientButton.style.backgroundColor = "#16a085";
            gradientButton.style.color = "white";
            gradientButton.style.cursor = "pointer";
            gradientButton.onclick = () => {
                const randomColor1 = `#${Math.floor(Math.random() * 16777215).toString(16)}`;
                const randomColor2 = `#${Math.floor(Math.random() * 16777215).toString(16)}`;
                document.body.style.background = `linear-gradient(to right, ${randomColor1}, ${randomColor2})`;
                document.body.setAttribute("data-gradient-active", "true");
            };
            contentSections[1].appendChild(gradientButton);

            // Images Tab
            const imageInput = document.createElement("input");
            imageInput.type = "text";
            imageInput.placeholder = "Enter image URL";
            imageInput.style.width = "100%";
            imageInput.style.marginBottom = "10px";
            imageInput.style.padding = "10px";
            imageInput.style.borderRadius = "8px";
            imageInput.style.border = "1px solid #ccc";
            imageInput.style.textAlign = "center";
            imageInput.onchange = () => {
                document.body.style.background = `url(${imageInput.value}) no-repeat center center fixed`;
                document.body.style.backgroundSize = "cover";
                document.body.removeAttribute("data-gradient-active");
            };
            contentSections[2].appendChild(imageInput);

            // Fun Tab
            const rainButton = document.createElement("button");
            rainButton.textContent = "Toggle Make it Rain";
            rainButton.style.width = "100%";
            rainButton.style.padding = "10px";
            rainButton.style.border = "none";
            rainButton.style.borderRadius = "8px";
            rainButton.style.backgroundColor = "#f1c40f";
            rainButton.style.color = "white";
            rainButton.style.cursor = "pointer";
            rainButton.onclick = makeItRain;
            contentSections[3].appendChild(rainButton);

            document.body.appendChild(panel);
            makeDraggable(panel);
        }

        showIntro(createUI);
    })();
})();
